import React, { useState, Dispatch, SetStateAction } from "react";

type CardList = {
    id: string
};

type CardObject = {
    cardList: CardList[]
}

const CardTest = ({
    cardList,//pass NFT cards here we should process them beforehand to build our own structure
}: CardObject): JSX.Element => {

    const anim = (id: number, e: React.MouseEvent<HTMLElement, MouseEvent>): void => {
        const elementId = (e.target as HTMLElement).id;
        const x = document.getElementById(elementId);

        if (x) {
            switch (id) {
                case 1:
                    x.className = "card animate__animated animate__backOutUp"

                    break;
                case 2:
                    x.className = "card animate__animated animate__bounceOutUp"

                    break;
                case 3:
                    x.className = "card animate__animated animate__fadeOutUp"

                    break;
                case 4:
                    x.className = "card animate__animated animate__zoomOutUp"

                    break;
                case 5:
                    x.className = "card animate__animated animate__slideOutUp"

                    break;

                default:
                    break;
            }
        }
    };
    const testData = [1, 2, 3, 4, 5, 6, 7, 8, 9] //try to map through so that we only use one article 
    return (

        <section className="card-list mt-96">
            <article id="card-1" onClick={(e) => anim(1, e)} className="card">
            </article>

            <article id="card-2" className="card" onClick={(e) => anim(2, e)}>
            </article>

            <article id="card-3" className="card" onClick={(e) => anim(3, e)}>
            </article>

            <article id="card-4" className="card" onClick={(e) => anim(4, e)}>
            </article>
            <article id="card-5" className="card" onClick={(e) => anim(5, e)}>
            </article>
        </section>
    );
};

export default CardTest;
